import './App.css';
import Header from './Components/Header';
import Home from './Components/Home';
import { BrowserRouter as Router, Route, Link, Switch } from 'react-router-dom'; 

function App() {
  return (
    <div className="App">
      <Router>
        <Link to='/'>Home</Link>
        <Link>About</Link>
      </Router>
    </div>
  );
}

export default App;
